def register_vcs_handler(vcs: str, method: str) -> Callable:  # decorator
    def decorate(f: Callable) -> Callable:
        if vcs not in HANDLERS:
            HANDLERS[vcs] = {}
        HANDLERS[vcs][method] = f
        return f
    return decorate

